			epilogueId = nil;
			angle = 0;
			briefing = {
				[0] = {
					content = "Our success in the Myrmidon System has caught the Gaitori by surprise. The last thing they expected was an offensive initiated by the Ishiman Stellar Navy. Your instinctual aggressiveness served you well.\n\nYour goal in the Demeter System is to capitalize on the Gaitori's disarray by seizing one of their planet-based outposts threatening our space. This is an opportunity for you to demonstrate the ability to coordinate a space-to-surface assault.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Demeter";
				};
				[1] = {
					kind = "object";
					title = "Cruiser";
					content = "^P1001^You'll initially be using this standard cruiser. By utilizing our base on Alpha, you'll be able to manufacture as many of these cruisers as you can afford.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 1;
				};
				[2] = {
					kind = "object";
					title = "Demeter Alpha";
					content = "You must protect our base on Demeter Alpha from enemy transports. If a Gaitori transport lands on Alpha, the mission will be aborted.\n\nThe base on Alpha can produce two types of ships in addition to cruisers. \n^P1014^Fighters are fast, but can only travel at sublight speeds. Their only weapons are photokinetic beam cannons.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 0;
				};
				[3] = {
					kind = "object";
					title = "Demeter Alpha";
					content = "^P1025^The transport is the only ship capable of space-to-surface assault. They are limited to sublight travel and are unarmed.\n\nFor this mission you'll need to give a transport orders to go to Demeter Beta. It will attempt to land once it arrives.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 0;
				};
				[4] = {
					kind = "object";
					title = "Demeter Beta";
					content = "This planet is your objective. Land a transport here to complete the mission.\n\nThe base here can produce four types of ships.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 5;
				};
				[5] = {
					kind = "object";
					title = "Demeter Beta";
					content = "^P1039^Gaitori fighters are slow, and poorly armored.\n^P1038^You've already encountered several of their cruisers.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 5;
				};
				[6] = {
					kind = "object";
					title = "Demeter Beta";
					content = "^P1087^Destroy any of their transports you find making its way towards our base on Alpha. If our base is lost, the mission will be aborted.\n\nThe Gaitori base can also construct gunships.\n^P1065^\nGood luck.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 5;
				};
