			briefing = {
				[0] = {
					content = "A civilian Obish vessel was seized by a rogue band of Gaitori mercenaries, loyalists to the Order. The mercenaries are holding the surviving Obiards captive in a group of deep space cells. Your mission in the Elysium System is to help the Obish rescue the hostages.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Elysium System";
				};
				[1] = {
					content = "^P10033^This mission has special significance. We have confirmed that one of the Obiards being held is Ambassador Thrntz, a key negotiator in the Obain/Gaitor Nonaggression Pact. His safe return would win you considerable favor with the Obiards.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Elysium System";
				};
				[2] = {
					kind = "object";
					title = "Heavy Cruiser";
					content = "You will be conducting this mission from a heavy cruiser. There is little margin for error in this enterprise; conservation of your heavy cruiserÕs resources will be vital for success.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 5;
				};
				[3] = {
					kind = "object";
					title = "Transport";
					content = "To pick up the prisoners, you'll be escorting this sublight Obish transport. It is armed with minimal defensive lasers capable of breaking the deep space cells open. Once a cell is breached, the prisoners will escape and attempt to enter the transport.\n\nThe Obish prisoners will be vulnerable to your weapons fire, since your targeting systems will not be keyed to their suits. Be careful not to catch them in crossfire. They will also be disoriented, so give them plenty of time to enter the transport.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 1;
				};
				[4] = {
					kind = "object";
					title = "Cell 1";
					content = "There are three deep space cells, each holding five Obiards. Command the transport to each cell in turn, then allow it to break open the cell and pick up the prisoners. The cells will be guarded, and your transport will need protection.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 3;
				};
				[5] = {
					kind = "object";
					title = "Passenger Liner";
					content = "The transport can carry all five Obiards contained in a deep space cell. When the transport has picked up the prisoners at a cell, command it to return to this waiting Obish passenger liner. The Obiards will exit the transport and enter the liner.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 0;
				};
				[6] = {
					content = "In addition to the ships guarding the cells, there are several squadrons of Gaitori fighters and cruisers on maneuvers in the vicinity. You should monitor the transport's position closely, as enemy cruisers could appear and quickly overtake the transport at any time. DonÕt stray too far from the transportÕs side.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Elysium System";
				};
				[7] = {
					kind = "object";
					title = "Escort";
					content = "An Obish cruiser will escort the transport. It is under the command of the Obiards, so it will not be available for you to control.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 6;
				};
				[8] = {
					content = "For the mission to be considered successful, you must rescue at least eleven of the fifteen total hostages. Good luck.";
					kind = "freestanding";
