			epilogueId = nil;
			angle = 0;
			briefing = {
				[0] = {
					content = "The Gaitori defeat in the Demeter system effectively ended their potency near Ishiman space; now we must take the battle to them.\n\nWe traced the jumpstream from Elysium to here, the Aeneas system. We believe it's the primary base of operations for the Cantharan-loyal military.\n\nYour mission is to occupy their base, and to rout them from the system.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Aeneas System";
				};
				[1] = {
					kind = "object";
					title = "Cruiser";
					content = "^P1001^You'll start in a single standard cruiser, but you'll be able to build more.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 0;
				};
				[2] = {
					kind = "object";
					title = "Aeneas Beta";
					content = "The Gaitori have a planet base on Aeneas Beta, one of the two planets in the system. Their planet is defended by a flak drone.\n^P1094^Flak drones are indestructible. In addition to having guided rockets, they can fire deadly flak over a wide area. The only way to gain control of a flak drone is with an engineering pod.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 8;
				};
				[3] = {
					kind = "object";
					title = "Aeneas Alpha";
					content = "You'll be coordinating the assault from our base on Aeneas Alpha.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 1;
				};
				[4] = {
					kind = "object";
					title = "Aeneas Alpha";
					content = "^P1096^In addition to fighters, cruisers, and transports, our base can produce engineering pods. Send these robot ships to flak drones to gain control of them. Once an engineering pod reaches a flak drone, the drone will be configured to fire on enemy ships.\n\nThe engineering pods are equipped with defensive lasers, capable of protecting them briefly from missiles and enemy ships. The pods are invisible to the flak drones' sensors, but they are still susceptible to weapons fire.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 1;
				};
				[5] = {
					kind = "object";
					title = "Aeneas Beta";
					content = "The Gaitori base on Beta is your objective. Land a transport here to complete the mission.\n^P1095^The Gaitori can also make fighters, cruisers, transports and engineering pods. Their engineering pods also have defensive lasers.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 8;
				};
				[6] = {
					kind = "object";
					title = "Flak Drone";
					content = "^P1094^There's a flak drone positioned directly between the two planets of Aeneas. You may want to send an engineering pod to this drone first in order to prevent it from firing on any of your transports on their way to Beta.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 6;
				};
				[7] = {
					kind = "object";
					title = "Heavy Destroyer";
					content = "^P1244^There's a Gaitori heavy destroyer currently over Beta. Compared to our cruisers, it is an extremely dangerous ship.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 5;
				};
