			briefing = {
				[0] = {
					kind = "object";
					title = "Asteroid IR7-7e";
					content = "The miners in this system alerted us when they detected a Cantharan ship pursuing a rogue asteroid.\n^P10034^Our preliminary analysis suggests that the asteroid has been artificially manufactured.";
