				[1] = {
					kind = "object";
					title = "Asteroid IR7-7e";
					content = "^P10040^Its trajectory indicates that it originated in the Los Ran system, and we believe it may be a remnant of the ancient Boodan War of Cantharis. ";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 2;
				};
				[2] = {
					kind = "object";
					title = "Asteroid IR7-7e";
					content = "The Cantharans' interest in this asteroid is alarmingly peculiar. We intend to destroy it, but we'd like to collect some samples to determine its purpose.\n^P1185^You must break the asteroid into pieces small enough to be collected. We require a minimum of four samples of its debris.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 2;
				};
				[3] = {
					kind = "object";
					title = "Astrominer";
					content = "^P1081^The astrominer has been ordered to follow you. Guide it to the asteroid and the astrominer will attempt to break it apart. The minerÕs bulky appearance belies its vulnerability to weapons fire. Protect it from attack: it is not a military vessel.\nThe astrominer is equipped with two short-range non-concussive solitoid cannons, which will gradually weaken the asteroid's structure.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 1;
				};
				[4] = {
					kind = "object";
					title = "Philemon Beta";
					content = "^P1062^A single heavy cruiser should be a sufficient escort for the astrominer. If the cruiser is destroyed, you may attempt to complete the mission without it, but the astrominer is almost incapable of defending itself.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 5;
				};
				[5] = {
