			briefing = {
				[0] = {
					content = "The Heshac System is owned by Salril. The presence of the deep space simlabs indicates that the Salrilians are using it as part of their Oracular Network. To our surprise, however, the beings inside the simlabs are human.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Heshac System";
				};
				[1] = {
					content = "Your mission in the Heshac System is to destroy the simlabs and to rescue as many humans as possible.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Heshac System";
				};
				[2] = {
					kind = "object";
					title = "Heavy Destroyer";
					content = "^P1130^For this mission youÕll be using a single destroyer. ItÕs a powerful vessel, armed with a fullerene pulse gun, twin lepton beam cannons, and one hundred and fifty concussion missiles. You'll also have two fighters for escort.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 1;
				};
				[3] = {
					kind = "object";
					title = "";
					content = "^P10002^YouÕll actually be making use of the UNS Ares in the Heshac system, as it is the ship best equipped for holding humans. For obvious reasons, the UNS Ares will not be engaging any enemy ships, or approaching the Salrilian installations.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 0;
				};
				[4] = {
					kind = "object";
					title = "Lab";
					content = "^P1210^At each simlab, fire at the installation until you rip open its walls. Take care, because once the simlab is open, the humans will escape, and your weapons will not be keyed to the humansÕ life signs so the humans will be vulnerable to your weapons fire.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 2;
				};
				[5] = {
					kind = "object";
					title = "Heavy Destroyer";
					content = "Your destroyer has been specially modified to allow the humans to enter from the outside. However, youÕll only be able to hold five of them at a time. When you have as many humans aboard as possible, return them to the UNS Ares.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 1;
				};
				[6] = {
					kind = "object";
					title = "Cruiser";
					content = "^P1113^There are an assortment of Salrilian and Cantharan ships guarding the simlabs. The Salrilian warships are nimble and powerful. Even with the destroyer, youÕll find engaging them a challenge.^P1111^";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 12;
				};
				[7] = {
					content = "For this mission to be considered successful, you must rescue at least twenty one of the thirty humans in the labs. Good luck.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Heshac System";
				};
			};
