			epilogueId = nil;
			angle = 0;
			briefing = {
				[0] = {
					content = "The Fansi System was once the front line Gaitori base of operations in Obish space during the Gaitori/Obish War. Today it's the last outpost of the Gaitori Isolationists--one of the few enemies of both Cantharis and Obain. It's also the last military obstacle between you and Cantharan Space.\n\nThe Cantharans intend to capture the Fansi System. Your objective is to beat them to it.";
					kind = "absolute";
					range = {
						y = 0;
						x = 0;
					};
					title = "Fansi";
				};
				[1] = {
					kind = "object";
					title = "Orbital Shipyard";
					content = "^P10057^Part of the Fansi System's value is its orbital shipyard. The Gaitori Isolationists haven't had the resources to make use of it, but there's a remnant of the Gaitori/Obish war here--a partially constructed Obish destroyer, built during Obain's brief occupation of the system near the end of the war. We will be completing the destroyer's construction for this mission.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 0;
				};
				[2] = {
					kind = "object";
					title = "Cargo Ship";
					content = "^P1119^To complete the construction of the Obish destroyer during the mission, five cargo ships will be exiting through a jump gate here. All five cargo ships must make it to the orbital shipyard in order for us to complete the destroyer. We'll alert you when the cargo ships are due to drop in-system, but it'll be up to you to make sure their path is clear.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 11;
				};
				[3] = {
					kind = "object";
					title = "Flak Drone";
					content = "^P1094^Send engineering pods to this flak drone to reconfigure it to fire on enemy vessels. The Gaitori Isolationists currently have it set to fire on all ships. Make sure you have control of it before the cargo ships arrive.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 13;
				};
				[4] = {
					kind = "object";
					title = "Bunker Station 1";
					content = "^P1105^This is one of two bunker stations in the Fansi system, both of which are occupied by Gaitori Isolationists. The bunker stations have powerful armament, but their defenses can be knocked out using heavy fire to reduce their shields.\n\nUse assault transports to gain control of the bunker stations--occupying the stations will generate resources for you during the mission.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 11;
				};
				[5] = {
					kind = "object";
					title = "Bunker Station 2";
					content = "^P1105^This is the other bunker station. If the Cantharans gain control of both the stations, they will most likely overwhelm you.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 4;
				};
				[6] = {
					kind = "object";
					title = "Fansi Alpha";
					content = "We've set up a base of operations here on Fansi Alpha, where you'll be able to produce a variety of ships. As usual, allowing the enemy to land a transport here will force us to abort the mission.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 9;
				};
				[7] = {
					kind = "object";
					title = "Engineer Pod";
					content = "In addition to fighters, cruisers, gunships, and transports, the base on Fansi can produce two special-purpose ships.\n^P1096^Build engineering pods to gain control of the flak drones. Make sure you commandeer the flak drone that lies between Bunker Station 1 and the orbital shipyard, to ensure the safe passage of the freighters.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 9;
				};
				[8] = {
					kind = "object";
					title = "Assault Transport";
					content = "^P1102^Assault Transports are the only ships designed to gain control of bunker stations. Our assault transports carry twelve extravehicular assault troopers. Six EVA troopers can exit the transport at once, and the assault transport will automatically dispatch them when it arrives at a hostile barrack station. At least five troopers must enter the station to control it.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 9;
				};
				[9] = {
					kind = "object";
					title = "Fansi Beta";
					content = "The Cantharan base on Fansi Beta is your ultimate goal. Land a standard transport here to complete the mission. The Cantharans have ship building facilities equivalent to ours.\n^P1120^In addition to fighters, cruisers, transports, and gunships, the Cantharans have assault transports of their own. Destroy them, and the EVA Troopers they release.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 10;
				};
				[10] = {
					kind = "object";
					title = "Engineer Pod";
					content = "^P1121^Cantharan engineering pods, like our own, are equipped with defensive repulser beam cannons.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 10;
				};
				[11] = {
					kind = "object";
					title = "Carrier";
					content = "^P1046^The Cantharan carrier the Song of Zom is already in the Fansi system. Its missiles are very effective against the bunker stations' defenses.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 12;
				};
			};
