			briefing = {
				[0] = {
					content = "^P1127^The Banadee, an Elejeetian luxury passenger liner, has been disabled by Gaitori pirates. The Elejeetian Minister of Automation, Jommo, along with most of the other passengers, has abandoned ship.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "EACSR Banadee";
				};
				[1] = {
					content = "Your mission in the Secorem System is to recover the Banadee's escape pods, and to aid a tractor tug in its recovery of the liner. The Elejeetian Empire is anxious to see Minister Jommo returned safely.^P10045^";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "EACSR Banadee";
				};
				[2] = {
					kind = "object";
					title = "Heavy Destroyer";
					content = "^P1130^You'll have the use of this destroyer for this mission.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 11;
				};
				[3] = {
					content = "^P1065^Before you commence the rescue operation, you need to destroy the Gaitori pirates, who are still in the Secorem system. You'll find the destroyer more than adequate for the task.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Secorem";
				};
				[4] = {
					content = "^P1129^Don't allow any of the escape pods to be destroyed while you engage the Gaitori, or the mission will be aborted.\n\nWhen the Secorem system is clear, recover all six escape pods from the Banadee. ";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Escape Pod";
				};
				[5] = {
					kind = "object";
					title = "Secorem Jump Gate";
					content = "^P10030^Once you've safely recovered all six escape pods, the civilian tractor tug will be entering here through the Secorem Jump Gate. It's bringing two heavy cruisers for escort.\n^P1128^";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 7;
				};
				[6] = {
					content = "The tractor tug will rendezvous with the Elejeetian liner Banadee, and tow it back to the jump gate. Once the liner passes through the gate, your mission will be complete.\n\nIt's unusual to find Gaitori pirates this deep into Cantharan space, and unlikely that they would be capable of disabling an Elejeetian liner-- prepare for the unexpected.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Secorem";
				};
			};
