			epilogueId = nil;
			angle = 0;
			briefing = {
				[0] = {
					content = "^P10044^The Bokleo System was a neutral Bazidanese trading outpost until the Cantharan Order occupied it. However, the Cantharans are not interested in disrupting the trading routes--they have a much greater prize.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Bokleo Alpha";
				};
				[1] = {
					kind = "object";
					title = "Bazidanese";
					content = "^P10037^We're not sure what it is, but the Order somehow managed to capture this Bazidanese vessel intact. Long range scans indicate that it is fairly massive, and apparently well armed.\nSince Bazidan has always been very secretive about its military technologies, we are assuming that the Cantharans are as curious as we are, and that they intend to reverse engineer this ship. Your objective is to prevent them from doing so by forcing them out of the Bokleo System.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 1;
				};
				[2] = {
					kind = "object";
					title = "Tractor Moor";
					content = "^P1076^The Bazidanese ship is anchored in place by three tractor moors, which prevent the ship from moving or firing. You must destroy all three moors to free the ship. Although the release of the ship is not immediately imperative, we suspect the Bazidanese crew would be grateful. ";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 2;
				};
				[3] = {
					kind = "object";
					title = "Border Drone";
					content = "^P1079^In accordance with the Amilass Treaty, an invulnerable border drone has been stationed near the neutral trading outpost on Bokleo Beta. However, the Order has reconfigured it to fire on all hostile vessels. Unlike the flak drones youÕre familiar with, this border drone does not have flak artillery.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 7;
				};
				[4] = {
					kind = "object";
					title = "Bokleo Beta";
					content = "The border drone is controlled from the outpost on Bokleo Beta. Land a transport here to gain control of the drone; the drone cannot be controlled with an engineering pod. The outpost has no ship building capabilities.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 6;
				};
				[5] = {
					kind = "object";
					title = "Bokleo Gamma";
					content = "^P1063^The Cantharans have established a base on Gamma. It's capable of producing fighters, heavy cruisers, gunships, and transports.\nLanding a transport on Bokleo Gamma to control the base is your primary objective.\n^P1026^";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 8;
				};
				[6] = {
					kind = "object";
					title = "Bokleo Alpha";
					content = "^P1001^We didn't have time to establish a strong presence on Alpha. Our base can only produce fighters, cruisers, and transports. Be prepared for heavy losses.\n^P1014^";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 9;
				};
				[7] = {
					kind = "object";
					title = "ISN 8738810";
					content = "^P1048^We have committed two carriers to this mission's completion. The ISN 8738810 is on its first combat mission.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 10;
				};
				[8] = {
					kind = "object";
					title = "ISN 2020187";
					content = "^P1048^The ISN 2020187 has been repaired since the Battle of Sprist (in which you destroyed the Constant Voice of Doz).";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 11;
				};
				[9] = {
					kind = "object";
					title = "The Gentle Fingers of Zom";
					content = "^P1046^There are already three Cantharan carriers in the system and more are on the way. The Gentle Finger of Zom was one of the two ships which originally captured the Bokleo System.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 12;
				};
				[10] = {
					kind = "object";
					title = "The Chaste Dream of Doz";
					content = "^P1046^The Chaste Dream of Doz is the other carrier which first occupied Bokleo.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 13;
				};
				[11] = {
					kind = "object";
					title = "The Silent Question of Doz";
					content = "^P1046^The Silent Question of Doz has just joined the other two carriers.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 14;
				};
				[12] = {
					kind = "object";
					title = "Heavy Cruiser";
					content = "^P1062^You'll initially be using this heavy cruiser. You are welcome to transfer control to any other ship you see fit.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 0;
				};
