			epilogueId = nil;
			angle = 0;
			briefing = {
				[0] = {
					content = "The Cantharan gateship has withdrawn to Earth. It has activated a jumpgate disruption device, apparently a derivative of the Audemedon device you destroyed in the Ser system. Still, we believe we can get a single ship through a small jumpstream to intercept the gateship. This will be your last chance to destroy the gateship and to bring freedom to your home world.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Sol";
				};
				[1] = {
					content = "^P1062^We have two surprises for the Cantharan gateship. One is this enhanced heavy cruiser, the ship youÕll be using to engage the gateship. The Elejeetian Minister of Technology was most grateful for your services, and supplied us with some modifications to our standard heavy cruiser.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Sol";
				};
				[2] = {
					kind = "object";
					title = "Modified Cruiser";
					content = "The heavy cruiser is now armed with an Onas pulse gun, an energy weapon with very little drain. The cruiser has also been made faster and more nimble. Even so, it is by itself no match for the gateship.";
					visible = true;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 0;
				};
				[3] = {
					content = "Therefore, we have a second surprise: to destroy the gateship, weÕll be pushing a series of large, unstable asteroids into the Sol system through small jumpstreams from the Fergason Belt. Of course, a collision with one of these unstable asteroids would annihilate your heavy cruiser, but your task is to alter the course of the asteroids so that they collide with the gateship.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Sol";
				};
				[4] = {
					kind = "object";
					title = "Gate Ship";
					content = "We doubt that the gateship is capable of forming another jumpgate in its damaged state. Some of its weapons may also be inoperable. We estimate, though, that it will take two or more collisions with asteroids to destroy the gateship.";
					visible = false;
					range = {
						y = 0;
						x = 0;
					};
					objectId = 2;
				};
				[5] = {
					content = "While youÕre engaging the gateship, the remaining human carriers will be launching a major assault lightyears away in the Upsilon Andromeda system. Although the humans are expecting heavy losses, this assault is merely intended to draw the Cantharan fleet away from Sol and the Cantharan gateship. They are depending on you to deliver them a liberated Earth. You must not fail.";
					kind = "freestanding";
					range = {
						y = 0;
						x = 0;
					};
					title = "Sol";
				};
			};
